(function() {var css = "";
if (false || (document.location.href.indexOf("https://bs.to") == 0) || (document.location.href.indexOf("https://burningseries.ac") == 0) || (document.location.href.indexOf("https://burningseries.co") == 0) || (document.location.href.indexOf("https://burningseries.cx") == 0) || (document.location.href.indexOf("https://burningseries.sx") == 0) || (document.location.href.indexOf("https://burningseries.vc") == 0))
	css += [
		"html {",
		"}",
		"",
		"body>#root>header a.banner {",
		"    box-shadow: 0 0 3px #000;",
		"    -moz-box-shadow: 0 0 3px #000;",
		"    -webkit-box-shadow: 0 0 3px #000;",
		"    background: url(data:image/jpeg;base64,) no-repeat #2b2b2b;",
		"}",
	].join("\n");
if (typeof GM_addStyle != "undefined") {
	GM_addStyle(css);
} else if (typeof PRO_addStyle != "undefined") {
	PRO_addStyle(css);
} else if (typeof addStyle != "undefined") {
	addStyle(css);
} else {
	var node = document.createElement("style");
	node.type = "text/css";
	node.appendChild(document.createTextNode(css));
	var heads = document.getElementsByTagName("head");
	if (heads.length > 0) {
		heads[0].appendChild(node);
	} else {
		// no head yet, stick it whereever
		document.documentElement.appendChild(node);
	}
}
})();
